import './App.css';
import MuiButton from './components/MuiButton';
import MuiSelect from './components/MuiSelect';
import MuiTextField from './components/MuiTextField';
import MuiTypography from './components/MuiTypography';

function App() {
  return (
    <div className="App">
      {/* <MuiTypography /> */}
      {/* <MuiButton /> */}
      {/* <MuiTextField/> */}
      <MuiSelect/>
      <MuiButton />
      <MuiNavbar />
      <MuiMenu />
      <MuiLink />
      <MuiBreadcrumbs />
      <MuiDrawer />
      <MuiSpeedDial />
      <MuiBottomNavigation />
      <MuiAvatar />
      <MuiBadge />
      <MuiList />
      <MuiChip />
      <MuiTooltip />
      <MuiTable />
      <MuiAlert />
      <MuiSnackbar />
      <MuiDialog />
      <MuiSkeleton />
      <MuiLoadingButton />
      <MuiDatePicker />
      <MuiDateRangePicker />
      <MuiTabs />
      <MuiTimeline />
      <MuiMasonry />
      <MuiResponsivness />

    </div>
  );
}

export default App;
